import picture from './zz.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={picture} className="picture" alt="pic" />
        <p>
          funny box moment
        </p>
        <form onsubmit="submit.disabled = true; button();">
          <label for="quote">funny text moment</label><br></br>
          <input type="text" placeholder="quote" name="quote" /><br></br>
          <input type="submit" name="submit" value="submit" />
        </form>
      </header>
    </div>
  );
}

function button() {
  alert("a");
  return true;
}

export default App;
